v [:p/code {:code \"nil\\n\"}]]], \"199\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"210\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(future - running ...)\"]]]], \"186\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"66\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"261\" [:div nil [:div [:p/markdown \"## Mathematic formula\"]]], \"152\" [:div nil [:div [:p/markdown \"### Vega-lite is suuported\"]]], \"341\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"181\" [:div nil [:div nil]], \"357\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"428\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"284\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"44\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"400\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"5\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"184\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] [:div nil]], \"100\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"363\" [:div [:p/code {:code \"^k/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"48\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"106\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]]]], \"386\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"173\" [:div nil [:div [:p/markdown \" Please check its usage condition before using it.\"]]], \"246\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}] [:div [:p/code \"(defn abcd [x] (+ x 9))\"]]], \"53\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"90\" [:div nil [:div nil]], \"190\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"112\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"18\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"36\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"222\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((2 2 3 2 2 3)\\n (5 1 3 2 4 5)\\n (0 3 3 1 0 2)\\n (5 5 1 1 5 1)\\n (5 2 3 5 2 5)\\n (5 2 5 0 0 2))\\n\"}]]], \"459\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(-0.37170261932635185\\n -0.09124612973642487\\n 0.12395535750829312\\n -0.023327564062848416\\n -0.11503460475233984\\n -0.4792157951225555\\n -0.592330311975112\\n -0.662563538938976\\n -0.771739730080799)\\n\"}]]]], \"250\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"148\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:ul [:li 0 \" \" [:p/sparklinespot {:data (0.002981878885724565 0.18127977109337468 0.10002876834832129 0.11703085511859519 0.1153577619010705 0.093609 :div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"130\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"200\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"431\" [:div nil [:div [:big [:big 3]]]], \"183\" [:div nil [:div nil]], \"313\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"38\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"223\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"272\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"320\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(future - running ...)\"]]]], \"325\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"205\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"306\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"287\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"122\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"229\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"316\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]]]], \"149\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"120\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"421\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"235\" [:div nil [:div [:p/markdown \"### hicc ier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]]]], \"260\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"390\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"95\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"102\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"377\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"165\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"153\" [:div [:p/code {:code \"^k/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] [:div [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]]], \"74\" [:div [:p/code {:code \"^k/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"353\" [:div [:p/code {:code \"^k/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] [:div [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]]], \"301\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"317\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"409\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"444\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"37\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"406\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(future - running ...)\"]]]], \"254\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"142\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"211\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"340\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"46\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"280\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"127\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"11\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"366\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"286\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"109\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"124\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"342\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"262\" [:div nil [:div [:p/markdown \"One way to generate mathematical form is to use the codegocs.com service.\"]]], \"252\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"138\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"319\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"256\" [:div [:p/code {:code \"[:hiccup [:
